const axios = require("axios");
const bmp = require("bmp-js");
const imgUrl = "https://upload.wikimedia.org/wikipedia/commons/thumb/2/2c/Rotating_earth_(large).gif/200px-Rotating_earth_(large).gif";
const imgUrlBase64 = "data:image/png;base64,";

const buffer = Buffer.from(imgUrlBase64, "utf-8");
const rawData = bmp.encode({ data: buffer, width: 200, height: 200});
console.log(`RAW`, rawData.data);

